import logo from './logo.svg';

import React, {Component} from 'react';


// Router
import {HashRouter as Router, Route, Switch} from "react-router-dom";

// CSS
import './css/App.css';
import './css/mobile.css';

// Pages


// Components



// App
class App extends Component {
  render() {
      return (
          <Router>
                  <div>
                    <Header/>
                    <Nav/>
                      <Switch>
                          <Route
                              render={() => (
                              <div>
                                  <h3>404</h3>
                              </div>
                          )}/>
                      </Switch>
                  </div>
          </Router>
      );
  }
}

export default App;
